class Solution(object):
    def kEmptySlots(self, flowers, k):
        """
        :type flowers: List[int]
        :type k: int
        :rtype: int
        """
        self.k = k
        self.l = len(flowers)
        self.positionList = []
        self.positionList.append(flowers[0])
        length = len(flowers)
        for i in xrange(1,length):
            left, right = self.helper(flowers[i])
            if i % 1000 == 0:
                if self.check() == False:
                    return -1
            if left - 1 == k or right - 1 == k:
                return i + 1
        return -1
            
    def check(self):
        temp = [1] + list(self.positionList) + [self.l]
        for i in xrange(len(temp)-1):
            if temp[i+1] - temp[i] - 1 > self.k:
                return True
        return False
        
    def helper(self, value):
        left = 0
        right = len(self.positionList) - 1
        if self.positionList[left] > value:
            leftValue = rightValue = self.positionList[0] - value
            self.positionList = [value] + self.positionList
            return leftValue, rightValue
        elif self.positionList[right] < value:
            leftValue, rightValue = value - self.positionList[-1], value - self.positionList[-1]
            self.positionList = self.positionList + [value]
            return leftValue, rightValue
        else:
            while True:
                middle = (left + right) // 2
                if self.positionList[middle] < value and self.positionList[middle+1] > value:
                    leftValue, rightValue = value - self.positionList[middle], self.positionList[middle+1] - value
                    self.positionList = self.positionList[:middle+1] + [value] + self.positionList[middle+1:]
                    return leftValue, rightValue
                elif self.positionList[middle] > value:
                    right = middle
                elif self.positionList[middle] < value and self.positionList[middle+1] < value:
                    left = middle
                    
            
